import React from 'react';
import logo from './logo.png';

const About = () => {
    return (
        <div class="tc ph4 pa4">
          <h1 class="link b f1 f-headline-ns tc db mb3 mb4-ns hover-red">BRUNO CUNHA.</h1>
            <div class="pa4 tc">
              <img src={logo} class="br2 h5 w5 dib o-60" alt="avatar" />
            </div>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">This is my personal portfolio, a work in progress.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Passionate about technology, and everything around it.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Skills in HTML, CSS and JavaScript.</p>
          <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Other skills like React.JS, Node.JS, SQL and NoSQL.</p>
          <div class="bb bw3 pa4 w5 center"> </div>
        </div>
    );
}

export default About;
